var dataTable = null;
var myMap = null;

function getDataSetItem(item) {
    var pk = item.pk;
    var weapon_source_country = item.fields.weapon_source_country;
    var weapon_deployment_location = item.fields.weapon_deployment_location;
    var data_source = item.fields.data_source;
    var location_cordinates_latitude = item.fields.location_cordinates_latitude;
    var location_cordinates_longitude = item.fields.location_cordinates_longitude;
    var data_magnitude_body = item.fields.data_magnitude_body;
    var data_magnitude_surface = item.fields.data_magnitude_surface;
    var location_cordinates_depth = item.fields.location_cordinates_depth;
    var data_yeild_lower = item.fields.data_yeild_lower;
    var data_yeild_upper = item.fields.data_yeild_upper;
    var data_purpose = item.fields.data_purpose;
    var data_name = item.fields.data_name;
    var data_type = item.fields.data_type;
    var date = item.fields.date;

    var dataSetItem = [
        pk,
        weapon_source_country,
        weapon_deployment_location,
        data_source,
        location_cordinates_latitude,
        location_cordinates_longitude,
        data_magnitude_body,
        data_magnitude_surface,
        location_cordinates_depth,
        data_yeild_lower,
        data_yeild_upper,
        data_purpose,
        data_name,
        data_type,
        date
    ]

    return dataSetItem;
}

function getDataTableColumnsTitles() {
    return [
        { title: 'ID' },
        { title: 'Country' },
        { title: 'Location' },
        { title: 'Data Source' },
        { title: 'Latitude' },
        { title: 'Longitude' },
        { title: 'Data Magnitude Body' },
        { title: 'Data Magnitude Surface' },
        { title: 'Location Cordinates Depth' },
        { title: 'Yeild Lower' },
        { title: 'Yeild Upper' },
        { title: 'Purpose' },
        { title: 'Name' },
        { title: 'Type' },
        { title: 'Date' }
    ]
}

function getDataSet() {
    var dataSet = [];

    for (let i = 0; i < data.length; i++) {
        var dataSetItem = getDataSetItem(data[i]);
        dataSet.push(dataSetItem);
    }

    return dataSet;
}

function getDistinctSortedValues(array, field) {
    var distinctValues = [...new Set(array.map(item => item.fields[field]))];
    return distinctValues.sort();
}

function loadSelectOptions(selectId, column) {
    var select = $(`#${selectId}`);

    var distinctValues = getDistinctSortedValues(data, column);

    var emptyOption = $('<option>', {
        value: '',
        text: 'Selecione uma opção'
    });

    select.append(emptyOption);

    $.each(distinctValues, function (index, option) {
        var newOption = $('<option>', {
            value: option,
            text: option
        });
        select.append(newOption);
    });
}

function selectChangedEvent(selectId, column_index, dataTable) {
    $(`#${selectId}`).on('change', function () {
        dataTable.column(column_index).search($(this).val()).draw();
        showMap();
    });
}

function groupAndCountByField(array, field) {
    var groups = {};

    array.forEach(function (item) {
        var fieldValue = item.fields[field];
        if (!groups[fieldValue]) {
            groups[fieldValue] = 1;
        } else {
            groups[fieldValue]++;
        }
    });

    var dataArray = Object.entries(groups);

    // Ordene o array com base nos valores numéricos (índice 1)
    dataArray.sort(function (a, b) {
        return a[1] - b[1];
    });

    var labels = [];
    var counts = [];

    // Itere sobre os pares chave-valor e crie as listas separadas
    dataArray.forEach(function (item) {
        var label = item[0];
        var count = item[1];
        labels.push(label);
        counts.push(count);
    });

    return {'labels': labels, 'data': counts}
}

function showMap() {
    if (myMap !== null) {
        myMap.remove();
    }

    myMap = L.map('map').setView([51.505, -0.09], 3);

    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
    }).addTo(myMap);

    // Obter os registros do DataTable.
    dataTable.rows({ 'search': 'applied' }).data().each(function (rowData) {
        var country = rowData[1];
        var location = rowData[2];
        var name = rowData[12];
        var type = rowData[13];
        var latitude = rowData[4];
        var longitude = rowData[5];

        var description = `${country}<br/>${location}<br/>${name}<br/>${type}`;

        L.marker([latitude, longitude]).addTo(myMap)
            .bindPopup(description)
    });
}

function mapContainerAlreadyInitialized() {
    // Verifique se o contêiner tem a classe CSS 'leaflet-container'
    return $('#map').hasClass('leaflet-container');
}

function generateBarChart(chartId, labels, data, dataSetLabel) {
    // Dados do gráfico
    var data = {
        labels: labels,
        datasets: [{
            label: dataSetLabel,
            data: data,
            backgroundColor: '#003eff',
            borderColor: '#003eff',
            borderWidth: 1
        }]
    };

    // Configurações do gráfico
    var options = {
        scales: {
            y: {
                beginAtZero: true
            }
        }
    };

    // Crie o gráfico de barras
    var ctx = document.getElementById(chartId).getContext('2d');

    var barChart = new Chart(ctx, {
        type: 'bar',
        data: data,
        options: options
    });
}

$(document).ready(function () {
    $("#tabs").tabs({
        activate: function (event, ui) {
            var activeTab = $(ui.newTab).text();

            switch (activeTab) {
                case 'Table':
                    break;
                case 'Map':
                    showMap();
                    break;
                case 'Charts':
                    break;
            }
        }
    });

    dataTable = new DataTable('#data-table', {
        columns: getDataTableColumnsTitles(),
        data: getDataSet()
    });

    loadSelectOptions('select-country', 'weapon_source_country');
    loadSelectOptions('select-location', 'weapon_deployment_location');
    loadSelectOptions('select-data-source', 'data_source');
    loadSelectOptions('select-purpose', 'data_purpose');
    loadSelectOptions('select-name', 'data_name');
    loadSelectOptions('select-type', 'data_type');

    selectChangedEvent('select-country', 1, dataTable);
    selectChangedEvent('select-location', 2, dataTable);
    selectChangedEvent('select-data-source', 3, dataTable);
    selectChangedEvent('select-purpose', 11, dataTable);
    selectChangedEvent('select-name', 12, dataTable);
    selectChangedEvent('select-type', 13, dataTable);

    var groupedDataCountry = groupAndCountByField(data, 'weapon_source_country');
    var groupedDataLocal = groupAndCountByField(data, 'weapon_deployment_location');
    var groupedDataSource = groupAndCountByField(data, 'data_source');
    var groupedDataPurpose = groupAndCountByField(data, 'data_purpose');
    var groupedDataName = groupAndCountByField(data, 'data_name');
    var groupedDataType = groupAndCountByField(data, 'data_type');

    generateBarChart('chart-1', groupedDataCountry.labels, groupedDataCountry.data, 'Count by Country');
    generateBarChart('chart-2', groupedDataLocal.labels, groupedDataLocal.data, 'Count by Local');
    generateBarChart('chart-3', groupedDataSource.labels, groupedDataSource.data, 'Count by Data Source');
    generateBarChart('chart-4', groupedDataPurpose.labels, groupedDataPurpose.data, 'Count by Purpose');
    generateBarChart('chart-5', groupedDataType.labels, groupedDataType.data, 'Count by Type');
});